description:
bán lô đất mặt đường lê thánh tông, tại dự án tổng kho 3 lạc viên
- diện tích: 70m², ngang 5m;
- hướng: bắc (đông tt);
 - pháp lý: bìa đỏ chính chủ;
 - vị trí ngay trong dự án tổng kho 3 với đầy đủ tiện ích trong hệ sinh thái. ngay bên cạnh là cầu hoàng gia sang vin vũ yên, tiềm năng vô cùng lớn rất phù hợp đầu tư sinh lời, khai thác thương mại, an cư lạc nghiệp;
- giá bán: 169 triệu/m² (có thỏa thuận nhẹ).
- quý khách quan tâm liên hệ xem đất 24/24: 0942184444. 
xin cảm ơn.!
